    @RequestMapping(value = "fun2",method = RequestMethod.GET )
    public String fun2(@RequestParam("provinceCode") String provinceCode,
                       @RequestParam("channelPkgInfo") String channelPkgInfo,
                       @RequestParam("creatTime") String creatTime ) {
        return "fun2---" + provinceCode + "----" + channelPkgInfo + "---" + creatTime;
    }
    @RequestMapping(value = "fun4",method = RequestMethod.POST)
    public String fun4 (@RequestParam(value = "sign",required =false) String sign,HttpServletRequest request) throws IOException {
        System.out.println("sign = " + sign);
        Enumeration<String> parameterNames = request.getParameterNames();
        while (parameterNames.hasMoreElements()) {
            String element = parameterNames.nextElement();
            System.out.println(element+"____"+ request.getParameter(element));
        }

        BufferedReader reader = request.getReader();
        String readerStr = "";// 接收用户端传来的JSON字符串（body体里的数据）
        String line;
        while ((line = reader.readLine()) != null){
            readerStr = readerStr.concat(line);
        }

        // 使用阿里的fastjson jar包处理json数据（这里是用map进行接收的，你也可以定义vo层容器类接收）
        HashMap params = JSONObject.parseObject(readerStr, HashMap.class);
        System.out.println("params = " + params);
        return JSON.toJSONString(params);
    }

